static void
comment(U *ctx, char *end)
{
	int c;

loop:
	while((c = input()) != end[0] && c != EOF && c != 0){
		if(c == '\n'){
			ctx->inp->src.col = 0;
			ctx->inp->src.line++;
		}else
			ctx->inp->src.col++;
	}
	if(c == EOF || c == 0)
		parseerror(ctx, "end of input inside comment");
	if((c = input()) != end[1] && c != EOF && c != 0){
		ctx->inp->src.col++;	/* end[0] */
		unput(c);
		goto loop;
	}
	if(c == EOF || c == 0)
		parseerror(ctx, "end of input inside comment");
}

